import React, { Component } from 'react';

import './styles.css';
import Pic from '../../images/homeimage.PNG';

class Home extends Component {

    render() {
        return (
            <div>
                <div className="nav-bar-home">
                    <div className="nav-bar-sub-home">
                        <label>SEIMS</label>
                    </div>
                    <div className="nav-bar-sub-link">
                        <a href="#" className="link">FACULTIES</a>
                        <a href="#" className="link">CONTACT US</a>
                        <a href="#" className="link">ABOUT US</a>
                        <a href="#" className="link">SIGN IN</a>
                        <a hef="#" className="link">SIGN UP</a>
                    </div>
                    <div className="container">
                        <div className="container-right">
                            <h2>SEIMS</h2><br/>
                            <img src={Pic} className="adver-image"/>
                        </div>
                        <div className="container-left">
                            <h1>Best place to learn</h1>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
